import React from "react";

import typeOf from "../../data/type.json";
import "./Type.css";

const Type = () => {
  return (
    <div>
      {typeOf.map((item) => (
        <div>
          <img src={item.image}></img>
          <div>
            <h2>{item.name}</h2>
            <p>{`${item.count} ${item.name}`}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default Type;
